import React from "react";
import { useState, useEffect } from "react";
import axios from "axios";

const Participants = () => {
  const [result, setResults] = useState([]);

  const fetchData = () => {
    var myHeaders = new Headers();
    myHeaders.append("Authorization", "Basic YWRtaW46ZkdBdXQzZXRxMmdAR0V5Uw==");
    myHeaders.append("Content-Type", "application/json");

    return axios
      .post(`http://cx-difc-pinedulev2.azurewebsites.net/api/hearing`, {
        myHeaders,
      })
      .then(function ({ data }) {
        return data;
      })
      .catch(function (error) {
        return error;
      });
  };

  useEffect(() => {
    fetchData().then((results) => {
      setResults(results.participants);
    });
  }, []);

  console.log(result);
  const url = result.map((participant, id) =>
    participant.joinURLs.url.replace(
      "https://udc-difc-staging.azurewebsites.net/",
      "https://udc-moj-uae-demo.azurewebsites.net/"
    )
  );
  return (
    <div>
      {result.map((participant, id) => (
        <ul>
          <li>{participant.name}</li>
          <li>
            {participant.joinURLs.url.replace(
              "https://udc-difc-staging.azurewebsites.net/",
              "https://udc-moj-uae-demo.azurewebsites.net/"
            )}
          </li>
        </ul>
      ))}
    </div>
  );
};

export default Participants;
